    .history_title {font-size: 25px;}   
    .his {
        width: 50%;
        float: left;
        box-sizing: border-box;
        margin-bottom: 0;
    }
    .history_box {
        display: flex;
        flex-wrap: wrap;
    }
    .history22 {
        border-right: 1px solid #666;
    }
    .history21 {
        border-bottom: 1px solid #666;
    }
