    }
    .history16 {
        border-right: 1px solid #666;
    }
    .empty06 {
        width: 50%; height: 170px;
        box-sizing: border-box;
    }
    .empty07 {
        width: 50%; height: 300px;
        box-sizing: border-box;
        background-image: url(./images/history02_317x192_tablet.jpg);
        background-repeat: no-repeat;
