        background-image: url(./images/history03_512x310_pc.jpg);
        background-repeat: no-repeat;
        background-position-x: 50%;
        background-position-y: 100%;

    }

    .news_letter {
        display: none;
    }

    .letter_box {display: none;}

    .web_mecenat {
        display: block;
        width: 1360px; height: 100px;
        margin: 0 auto;
        margin-top: 200px;
    }
    .web_lnb, .web_letter {
        width: 400px; height: 100px;
        float: left;
    }

    .web_lnb ul {
        width: 200px; height: 100px;
        float: left;
        box-sizing: border-box;
    }
    .web_lnb ul:first-child {border-right:1px solid #ccc;}
    .web_lnb ul li {
        height: 25px;
        margin: 0 auto;
        text-align: center;
        font-size: 13px;
    }


    .web_me {
        width: 560px; height: 100px;
        float: left;
        border-left: 1px solid #ccc;
        box-sizing: border-box;
    }
    .web_me div {
        width: 560px; height: 50px;
        float: left;
    }
    .web_me span {
        float: left;
    }
    .me span:first-child {
        width: 150px;
        line-height: 35px;
        margin-top: 6px;
        height: 35px;
        margin-left: 20px;
    }
    .me span:nth-child(2) {
        width: 30px; height: 30px;
        text-align: center;
        font-size: 17px;
        border: 1px solid #ccc;
        box-sizing: border-box;
        cursor: pointer;
        margin-top: 8px;
        line-height: 30px;
        margin-left: 10px;
    }
    .me span:nth-child(3) {
        width: 300px; height: 40px;
        margin-top: 3px;
        margin-left: 10px;
        position: relative;
        overflow: hidden;
    }
    .web_m {
        width: 1500px; height: 40px;
        position: absolute;
        top: 0; left: 0;
        animation: web 20s infinite linear;
    }
    @keyframes web{
        from {left: 0;}
        50% {left: -600px;}
        to {left: -1200px;}
    }
    .web_m li {
        width: 140px; height: 40px;
        float: left;
        margin-right: 10px;
    }
    .web_m li img {
        width: 100%; height: 100%;
    }



    .web_letter {
        border-left: 1px solid #ccc;
        box-sizing: border-box;
    }
    .web_letter p {
        text-align: center;
        font-size: 20px;
    }
    .web_letter button {
        border: 0;
        padding: 10px 20px;
        background-color: #2e3192;
        color: #eee;
        border-radius: 50px;
        font-size: 15px;
        margin-top: 15px;
        margin-left: 160px;
        cursor: pointer;
    }
    .web_letter button:hover {
        background-color: #ccc;
        color: black;
    }


    .footer {display: none;}

    .footer2 {
        display: block;
        width: 1360px; height: 200px;
        margin: 0 auto;
        margin-top: 100px;
        background-color: #eee;
    }
    .footer2 p {
        text-align: center;
        height: 150px;
        font-size: 13px;
        line-height: 30px;
    }
    .footer2 div {
        width: 510px; height: 50px;
        margin: 0 auto;
    }
    .footer2 div a {
        display: inline-block;
        width: 300px; height: 50px;
        overflow: hidden;
    }
    .footer2 div a:first-child{
        width: 180px;
        margin-right: 20px;
    }
    .footer2 div a img {width: 100%;}






   

